CREATE TABLE `tb_member` (
  `user_id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '自增id',
  `username` varchar(128) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '登录名',
  `qq_open_id` char(32) CHARACTER SET utf8 DEFAULT NULL COMMENT 'qq官方唯一编号信息',
  `qq_number` varchar(32) CHARACTER SET utf8 DEFAULT '' COMMENT 'qq',
  `password` char(64) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '登录密码',
  `email` varchar(64) CHARACTER SET utf8 DEFAULT '' COMMENT '邮箱',
  `is_active` char(1) CHARACTER SET utf8 DEFAULT '1' COMMENT '新用户是否已经通过邮箱激活帐号 0 激活 1 未激活',
  `sex` char(1) COLLATE utf8mb4_bin NOT NULL DEFAULT '男' COMMENT '用户性别（0男 1女 2未知）',
  `telephone` varchar(32) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '手机',
  `education` char(1) CHARACTER SET utf8 DEFAULT NULL COMMENT '学历  小学 1 初中 2 高中 3 专科 4 本科 5 硕士 6 博士 7',
  `hobby` varchar(32) CHARACTER SET utf8 DEFAULT '' COMMENT '爱好',
  `introduce` text COLLATE utf8mb4_bin COMMENT '简介',
  `status` char(1) CHARACTER SET utf8mb4 DEFAULT '0' COMMENT '帐号状态（0正常 1停用）',
  `del_flag` char(1) CHARACTER SET utf8mb4 DEFAULT '0' COMMENT '删除标志（0代表存在 1代表删除）',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(64) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '更新者',
  `create_by` varchar(64) CHARACTER SET utf8mb4 DEFAULT '' COMMENT '创建者',
  `update_time` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `remark` varchar(500) CHARACTER SET utf8mb4 DEFAULT NULL COMMENT '备注',
  PRIMARY KEY (`user_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_bin COMMENT='用户会员表';

